import "./App.css";

import Header from "./components/Header";

import { Routes, Route, BrowserRouter } from "react-router-dom";
import HomePage from "./pages/HomePage";
import About from "./components/About";

function App() {
  return (
    <div className="App">
      <Header />
      <HomePage />
      <About />
    </div>
  );
}

export default App;
